import React, { Component } from 'react';
class Signup extends Component {
    constructor(props) {
        super(props);
        this.state = {
            isLogin:true
          }
    }
    changeLogin=()=>
    {
        if(this.state.isLogin)
            this.setState({isLogin:false});
        else
            this.setState({isLogin:true});
    }
    render() { 
        return ( 
            <div>
                <input className='loginpage_text' type="text" placeholder='Mobile Number or Email'/>
                <input className='loginpage_text' type="text" placeholder='Full Name'/>
                <input className='loginpage_text' type="text" placeholder='Username'/>
                <input className='loginpage_text' type="text" placeholder='Password'/>
                <button className='loginpage_signinbutton' onClick={this.changeLogin}>Sign Up</button>
            </div>
         );
    }
}
 
export default Signup;
